// src/pages/AdminPanel.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

function AdminPanel() {
  const [appointments, setAppointments] = useState([]);
  const token = localStorage.getItem('token');

  useEffect(() => {
    axios.get('http://localhost:5000/bookings/admin/all', {
      headers: { Authorization: `Bearer ${token}` }
    })
    .then(response => setAppointments(response.data))
    .catch(error => {
      console.error(error);
      alert('Failed to fetch appointments');
    });
  }, [token]);

  return (
    <div style={{ maxWidth: '800px', margin: '50px auto' }}>
      <h1>Admin Panel - All Appointments</h1>
      <table style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr>
            <th style={{ border: '1px solid #ccc', padding: '8px' }}>Booking ID</th>
            <th style={{ border: '1px solid #ccc', padding: '8px' }}>User Name</th>
            <th style={{ border: '1px solid #ccc', padding: '8px' }}>User Email</th>
            <th style={{ border: '1px solid #ccc', padding: '8px' }}>Service</th>
            <th style={{ border: '1px solid #ccc', padding: '8px' }}>Date</th>
            <th style={{ border: '1px solid #ccc', padding: '8px' }}>Time</th>
            <th style={{ border: '1px solid #ccc', padding: '8px' }}>Status</th>
          </tr>
        </thead>
        <tbody>
          {appointments.map(appt => (
            <tr key={appt.booking_id}>
              <td style={{ border: '1px solid #ccc', padding: '8px' }}>{appt.booking_id}</td>
              <td style={{ border: '1px solid #ccc', padding: '8px' }}>{appt.user_name}</td>
              <td style={{ border: '1px solid #ccc', padding: '8px' }}>{appt.user_email}</td>
              <td style={{ border: '1px solid #ccc', padding: '8px' }}>{appt.service_name}</td>
              <td style={{ border: '1px solid #ccc', padding: '8px' }}>{appt.date}</td>
              <td style={{ border: '1px solid #ccc', padding: '8px' }}>{appt.time}</td>
              <td style={{ border: '1px solid #ccc', padding: '8px' }}>{appt.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default AdminPanel;
